import NewComponentExpenses from "./components/Expenses";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 10.5,
      date: new Date(2022, 9, 26),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 1250,
      date: new Date(2022, 9, 20),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.56,
      date: new Date(2022, 8, 10),
    },
    {
      id: "e4",
      title: "Yoga",
      amount: 100,
      date: new Date(2022, 8, 9),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
    </div>
  );
}

export default App;
